import React from 'react';
import ParticleAnimation from 'react-particle-animation';

function Background() {
    return (
        <div id="bg">
            <ParticleAnimation
                numParticles={200}
                background={{ r: 9, g: 13, b: 0, a: 1 }}
                style={{ position: 'fixed', width: '100%', height: '100%', zIndex: -1 }}
            />
            <header>
                <div className="stars"></div>
                <div className="twinkle"></div>
            </header>
            <div className="head">
                <h1><strong>Click anywhere to add more random constellations</strong></h1>
            </div>
        </div>
    );
}
export default Background
